import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import { MeetingRoom } from "./MeetingRoom";
import { Courses } from "./Courses";
import { Home } from "./Home";

function App() {
  return (
    <Router>
      <div className="min-h-screen bg-gray-100">
        {/* Navigation Bar */}
        <nav className="bg-white shadow-md px-6 py-4 flex justify-between items-center">
          <h1 className="text-2xl font-bold text-blue-600">CourseApp</h1>
          <div className="space-x-6">
            <Link to="/" className="text-gray-700 hover:text-blue-600 font-medium">Home</Link>
            <Link to="/courses" className="text-gray-700 hover:text-blue-600 font-medium">Courses</Link>
            <Link to="/meeting" className="text-gray-700 hover:text-blue-600 font-medium">Meeting Room</Link>
          </div>
        </nav>

        {/* Page Content */}
        <main className="p-6">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/courses" element={<Courses />} />
            <Route path="/meeting" element={<MeetingRoom />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
